-- NOTE: This script assumes student user IDs exist in the users table with role=3
-- You may need to adjust student_id values based on your actual user data
-- The script generates fictional student UUIDs that should be replaced with real ones

-- First, let's create some sample student users if they don't exist
-- (Skip this if you already have student users)
SELECT 
    'aa0e8400-e29b-41d4-a716-4466554' || LPAD(generate_series(1, 5000)::text, 5, '0'),
    'student' || generate_series(1, 5000) || '@university.ac.id',
    '$2a$10$92IXUNpkjO0rOQ5byMi.Ye4oKoEa3Ro9llC/.og/at2.uheWG/igi', -- password: 'password'
    3, -- student role
    '2015-01-01 10:00:00+00'::timestamptz + (random() * interval '9 years'),
    '2015-01-01 10:00:00+00'::timestamptz + (random() * interval '9 years'),
    NULL
WHERE NOT EXISTS (
    SELECT 1 FROM users WHERE id = 'aa0e8400-e29b-41d4-a716-4466554' || LPAD(generate_series(1, 5000)::text, 5, '0')
);

-- Now insert course registrations

-- Verify insert counts
SELECT 'Students inserted: ' || COUNT(*) as student_summary FROM users WHERE role = 3;
SELECT 'Course Registrations inserted: ' || COUNT(*) as registration_summary FROM course_registrations;

-- Show some enrollment statistics
SELECT 
    'Average enrollments per student: ' || ROUND(AVG(enrollment_count), 2) as avg_enrollments_per_student
FROM (
    SELECT student_id, COUNT(*) as enrollment_count
    FROM course_registrations
    GROUP BY student_id
) student_enrollments;
